// ============================================================================

/// Execute a CLI command
#[tauri::command]
pub async fn alden_cli_execute(
    request: ExecuteCommandRequest,
    state: State<'_, CliState>,
) -> Result<CliResponse, String> {
    let command = CliParser::parse(&request.command);
    let response = state.executor.execute(command, &request.user_id, None, None).await;

    let entry = CommandHistoryEntry {
        command: request.command.clone(),
        executed_at: Utc::now().to_rfc3339(),
        success: response.success,
    };
    state.append_history(&request.user_id, entry).await;

    Ok(response)
}

/// Return CLI command history for a user
#[tauri::command]
pub async fn alden_cli_history(
    request: CommandHistoryRequest,
    state: State<'_, CliState>,
) -> Result<Vec<String>, String> {
    let history = state.history.read().await;
    let entries = history.get(&request.user_id).cloned().unwrap_or_default();
    let commands: Vec<String> = if let Some(limit) = request.limit {
        let len = entries.len();
        let start = len.saturating_sub(limit);
        entries[start..]
            .iter()
            .map(|entry| entry.command.clone())
            .collect()
    } else {
        entries.iter().map(|entry| entry.command.clone()).collect()
    };
    Ok(commands)
}
