    /// Extract title (quoted string) and remaining flags
    fn extract_title_and_flags(args: &[&str]) -> (String, Vec<(String, String)>) {
        let input = args.join(" ");

        // Match quoted strings
        let re = Regex::new(r#""([^"]*)""#).unwrap();
        if let Some(captures) = re.captures(&input) {
            let title = captures.get(1).unwrap().as_str().to_string();
            let remaining = re.replace(&input, "").to_string();
            let flags = Self::parse_flags(&remaining.split_whitespace().collect::<Vec<_>>());
            (title, flags)
        } else {
            // No quotes - take first word as title
            if let Some(first) = args.get(0) {
                let title = first.to_string();
                let flags = Self::parse_flags(&args[1..]);
                (title, flags)
            } else {
                (String::new(), vec![])
            }
        }
    }

    /// Parse flags like --priority high --due 2025-11-15
    fn parse_flags(args: &[&str]) -> Vec<(String, String)> {
        let mut flags = Vec::new();
        let mut i = 0;

        while i < args.len() {
            if args[i].starts_with("--") {
                let key = args[i][2..].to_string();
                if i + 1 < args.len() && !args[i + 1].starts_with("--") {
                    let value = args[i + 1].trim_matches('"').to_string();
                    flags.push((key, value));
                    i += 2;
                } else {
                    i += 1;
                }
            } else {
                i += 1;
            }
        }

        flags
    }

    fn get_flag_value(flags: &[(String, String)], key: &str) -> Option<String> {
        flags.iter()
            .find(|(k, _)| k == key)
            .map(|(_, v)| v.clone())
    }
