export interface HearthlinkAppProps {
  useEnhancedUI: boolean;
  userId: string;
  focusFormulaLicenseToken?: string;
}

type AgentId = 'alden' | 'alice' | 'mimic' | 'core' | 'vault' | 'sentry' | 'synapse';

interface Agent {
  id: AgentId;
  name: string;
  icon: string;
  description: string;
}

/**
 * Main Hearthlink Application Component
 *
 * Provides comprehensive multi-agent interface with tabbed navigation
 * between all 7 agent dashboards.
 */
const HearthlinkApp: React.FC<HearthlinkAppProps> = ({
  useEnhancedUI,
  userId,
  focusFormulaLicenseToken
}) => {
  console.log('[HearthlinkApp] Component rendering with props:', { useEnhancedUI, userId });
  const [activeAgent, setActiveAgent] = React.useState<AgentId>('alden');

  const agents: Agent[] = [
    { id: 'alden', name: 'Alden', icon: 'dY"<', description: 'Task Management & Planning' },
    { id: 'alice', name: 'Alice', icon: 'dY', description: 'Behavioral Analysis' },
    { id: 'mimic', name: 'Mimic', icon: 'dYZ-', description: 'Dynamic Persona' },
    { id: 'core', name: 'Core', icon: 's', description: 'Communication Hub' },
    { id: 'vault', name: 'Vault', icon: 'dY"?', description: 'Secure Memory' },
    { id: 'sentry', name: 'Sentry', icon: 'dY>,?', description: 'Security & Compliance' },
    { id: 'synapse', name: 'Synapse', icon: 'dYO?', description: 'External Gateway' },
  ];

  const renderDashboard = () => {
    switch (activeAgent) {
      case 'alden':
        return <AldenCommandCenter userId={userId} />;
      case 'alice':
        return <AliceDashboard userId={userId} />;
      case 'mimic':
        return <MimicDashboard userId={userId} />;
      case 'core':
        return <CoreDashboard userId={userId} />;
      case 'vault':
        return <VaultDashboard userId={userId} />;
      case 'sentry':
        return <SentryDashboard userId={userId} />;
      case 'synapse':
        return <SynapseDashboard userId={userId} />;
      default:
        return <AldenCommandCenter userId={userId} />;
    }
  };

  const currentAgent = agents.find(a => a.id === activeAgent);

  return (
    <div className="h-screen flex flex-col bg-background text-foreground">
      {/* Radial Module Menu - Glassmorphic overlay navigation */}
      <RadialModuleMenu
        activeModule={activeAgent as ModuleName}
        onModuleChange={(module) => setActiveAgent(module as AgentId)}
      />

      {/* Main Content Area - Full screen, no header */}
      <main className="flex-1 overflow-auto bg-background">
        <div className="h-full">
          {renderDashboard()}
        </div>
      </main>
    </div>
  );
};

export default HearthlinkApp;
